import axios from "axios";

const request = axios.create({
    baseURL:"/api",
    timeout:5000,
})

requests.interceptors.request.use((config)=>{
    return config;
})

requests.interceptors.request.use((res)=>{
    return res.data;
},(error)=>{
    return Promise.reject(new Error('faile'));
});

export default axios;
